// SPDX-License-Identifier: MIT

pragma solidity >=0.5.0 <0.9.0;

contract Twitter {

    struct Tweet {
        uint id;
        address author; // name 
        string content; // tweet
        uint createdAt; // time
    }

    struct Message {
        uint id;
        string content; // message
        address from; // from 
        address to; // to 
        uint createdAt; // time
    }

    mapping(uint => Tweet) public tweets; // storing tweet 
    mapping(address => uint[]) public tweetsOf; //0xabc - 2,10,15,19,20,22
    mapping(address => Message[]) public conversations; //
    mapping(address => mapping(address => bool)) public operators;
    mapping(address => address[]) public following;

    uint nextId; //0
    uint nextMessageId;


    function _tweet(address _from, string memory _content) internal {
        //tweet access check - owner,authority
        require(_from == msg.sender || operators[_from][msg.sender], "You don't have access");
        tweets[nextId] = Tweet(nextId, _from, _content, block.timestamp);
        tweetsOf[_from].push(nextId);
        nextId = nextId + 1;
    }


    function _sendMessage( address _from, address _to, string memory _content) internal {
